import React from 'react'

const Card = ({ id, name, username, email }) => {
  return (
    <div
      key={id}
      id={id}
      className="bg-green-300 drop-shadow-md"
    >
      <img src={`https://robohash.org/${id}?200x200`} alt="robots" />
      <div className="tc">
        <h1>{username}</h1>
        <h2>{name}</h2>
        <p>{email}</p>
      </div>
    </div>
  )
}

export default Card;
